webpackJsonp([64203802486574],{3753:function(a,t){a.exports={data:{markdownRemark:{html:'<p>弾幕風スクリプトにステージスクリプト“<a href="/tag/touhou-in-phantasm">永夜抄Phantasm～月夜に魅せられた少女(体験版)</a>”を追加。</p>\n<h2>本日の駄文</h2>\n<p>先月、事故で<a href="/lead50">リード50</a>が大破してから半月強、やっと新しい単車<a href="/tag/yb-1">ヤマハYB-1</a>を入手しました。 手に入れたからには豪雨にも関わらず試し乗り。やっぱり噂と違わず出だしが遅い。ただミッション車だけあってまだ改造の余地は有り余っているし、なんと言っても見かけはサイコー。スーフォアに比べてクラッチのつながりが悪いと思ったのは400と50の違いなんだろうか。ベンリィ乗ってたのかなり昔だったから感覚忘れちゃってる。 さて、そろそろ乗り物紹介ページも作るかの。(その前にさっさと画像のindex作れよ←自分)</p>',frontmatter:{cover:null,date:"2004-09-04T15:44:00+09:00",strDate:"2004/9/4",title:"永夜抄Phantasm ～ 月夜に魅せられた少女"}}},pathContext:{path:"/ja/blog/2004/09/04-永夜抄phantasm-～-月夜に魅せられた少女/",langKey:"ja"}}}});
